import React, { useState } from "react";
import Page from "../components/common/Page";
import Card from "../components/ui/Card";
import Button from "../components/ui/Button";

const PrivacyPolicyPage = () => {
  const [expandedSection, setExpandedSection] = useState(null);

  const sections = [
    {
      id: "collection",
      title: "Сбор информации",
      summary: "Какую информацию мы собираем",
      content:
        "Мы собираем только необходимую информацию для предоставления наших услуг, включая данные об использовании сервиса и техническую информацию о вашем устройстве.",
    },
    {
      id: "usage",
      title: "Использование информации",
      summary: "Как мы используем вашу информацию",
      content:
        "Собранная информация используется для улучшения качества сервиса, персонализации пользовательского опыта и обеспечения безопасности.",
    },
    {
      id: "sharing",
      title: "Передача информации",
      summary: "Когда мы делимся информацией",
      content:
        "Мы не продаем и не передаем вашу личную информацию третьим лицам без вашего согласия, за исключением случаев, предусмотренных законом.",
    },
    {
      id: "security",
      title: "Безопасность данных",
      summary: "Как мы защищаем ваши данные",
      content:
        "Мы применяем современные методы шифрования и защиты данных для обеспечения безопасности вашей информации.",
    },
  ];

  const toggleSection = (sectionId) => {
    setExpandedSection(expandedSection === sectionId ? null : sectionId);
  };

  return (
    <Page
      title="Политика конфиденциальности - VideoEditor"
      description="Узнайте, как мы защищаем и используем вашу личную информацию"
    >
      <div className="max-w-4xl mx-auto space-y-8">
        <div className="text-center">
          <h1 className="text-3xl font-bold text-gray-800 mb-4">
            Политика конфиденциальности
          </h1>
          <p className="text-gray-600">
            Мы серьезно относимся к защите вашей конфиденциальности
          </p>
        </div>

        <Card className="bg-green-50 border-green-200">
          <div className="flex items-start space-x-3">
            <div className="text-green-500 text-xl">🔒</div>
            <div>
              <h3 className="font-semibold text-green-800 mb-2">
                Ваши данные в безопасности
              </h3>
              <p className="text-green-700 text-sm">
                Мы используем шифрование SSL и современные методы защиты данных
                для обеспечения безопасности вашей информации.
              </p>
            </div>
          </div>
        </Card>

        <div className="space-y-4">
          {sections.map((section) => (
            <Card key={section.id} className="transition-all duration-200">
              <div
                className="flex items-center justify-between cursor-pointer"
                onClick={() => toggleSection(section.id)}
              >
                <div>
                  <h3 className="text-lg font-semibold text-gray-800">
                    {section.title}
                  </h3>
                  <p className="text-gray-600 text-sm mt-1">
                    {section.summary}
                  </p>
                </div>
                <div className="text-gray-400">
                  {expandedSection === section.id ? "−" : "+"}
                </div>
              </div>

              {expandedSection === section.id && (
                <div className="mt-4 pt-4 border-t border-gray-200">
                  <p className="text-gray-700 leading-relaxed">
                    {section.content}
                  </p>
                </div>
              )}
            </Card>
          ))}
        </div>

        <div className="text-center">
          <p className="text-gray-600 mb-6">
            Остались вопросы о конфиденциальности?
          </p>
          <Button variant="secondary">Связаться с нами</Button>
        </div>
      </div>
    </Page>
  );
};

export default PrivacyPolicyPage;
